import GXParser from "./gx";
import RaftEngine from "../engines/base";

export default class G3DremParser extends GXParser {

    constructor (engine: RaftEngine) {
        super(engine);
    }

    public clone(): G3DremParser {
        return new G3DremParser(this.engine.clone());
    }

    toString(): string {
        return "G3DremParser";
    }

}
